import { Button, Typography } from '@mui/material'
import React from 'react'

const User = () => {
  return (
    <Box>
        <Typography>
            Connect your devices
        </Typography>
        <Button variant='contained' color="primary"></Button>
    </Box>
  )
}

export default User
